        touch-action: manipulation;
        margin: 0;
        font-family: inherit;
        overflow: visible;
        text-transform: none;
        display: inline-block;
        font-weight: 600;
        text-align: center;
        white-space: nowrap;
        vertical-align: middle;
        user-select: none;
        border: 0px solid transparent;
        padding: 0.5rem 1rem;
        font-size: 1rem;
        line-height: 0.8;
        border-radius: 0.25rem;
        transition: all 0.2s;
        background-color: #ffffff;
        border-color: #ffffff;
        box-shadow: 0 2px 8px rgba(27, 38, 49, 0.1);
        margin-top: 0 !important;
        margin-bottom: 0 !important;
        color: #0957d9;
        cursor: pointer;
    }
    </style>

        }
    }
